import React from 'react';
import bars from "../assets/bar.png";

export default function BarGraph() {
  return (
    <div style={{maxWidth:"800px",boxShadow: "rgba(0, 0, 0, 0.24) 0px 3px 8px",borderRadius: "0.5rem"}}>
        <img src={bars} alt='bargraph'/>
    </div>
  )
}
